/* RATINGS WON'T RENDER IN BUILDER */

/* To change the star rating, change the value of the data attribute in the attributes tab on this element. If you want the rating to be generated dynamically, create a "rating" custom field for your parent element and then inject the value of that field dynamically into the data attribute value field. */

.fr-rating-alpha {
	--icon-size: 1.5em;
  --icon-fill-color: var(--primary);
  --icon-stroke-color: var(--primary);
  --icon-fill-color-hover: var(--primary);  
  --icon-stroke-color-hover: var(--primary);
}

.fr-rating-alpha > *:first-child {display: none;} /* Hide half star by default */

[data-rating*="."] > *:first-child {display: flex;} /* Show half star for decimal ratings */

[data-rating*=".0"] > *:first-child {display: none !important;} /* Hide half star for .0 ratings */

/* Support for half star rating */
[data-rating*=".5"] > *:first-child {display: flex !important;}

[data-rating=".5"] > *:not(:first-child),
[data-rating="0.5"] > *:not(:first-child) {
	display: none;
}

/* The Rest */

[data-rating^="1"] > *:nth-child(n+3) {
 display: none;
}

[data-rating^="2"] > *:nth-child(n+4) {
 display: none;
}

[data-rating^="3"] > *:nth-child(n+5) {
 display: none;
}

[data-rating^="4"] > *:nth-child(n+6) {
 display: none;
}

.fr-rating-alpha svg {
  height: var(--icon-size);
  width: var(--icon-size);
  fill: var(--icon-fill-color);
  color: var(--icon-stroke-color);
}

.fr-rating-alpha i {
  color: var(--icon-fill-color);
  font-size: var(--icon-size);
}

.fr-rating-alpha svg:hover {
  fill: var(--icon-fill-color-hover);
  color: var(--icon-stroke-color-hover);  
}

.fr-rating-alpha i:hover {
  color: var(--icon-fill-color-hover);
}

.fr-badge-alpha {
	--icon-size: 1.5em;
  --icon-fill-color: transparent;
  --icon-stroke-color: var(--text-dark);
  --icon-fill-color-hover: transparent;  
  --icon-stroke-color-hover: var(--text-dark);
}

/* 
Attribute value is set via data attribute
on the icon wrapper. The value may not render
inside the editor, but will render on front end.
*/

.fr-badge-alpha__icon-wrapper::after {
  content: attr(data-badge-value);
  position: relative;
  display: flex;
  color: var(--text-dark);
}

.fr-badge-alpha__icon-wrapper :is(svg, i) {
  height: var(--icon-size);
  width: var(--icon-size);
  fill: var(--icon-fill-color);
  color: var(--icon-stroke-color);
}

.fr-badge-alpha__icon-wrapper :is(svg, i):hover {
  fill: var(--icon-fill-color-hover);
  color: var(--icon-stroke-color);  
}

/* Bricks Canvas fix */
:where(.brx-draggable:empty) {
  min-height: unset;
  min-width: unset;
}

